import React, { useState } from 'react';

function App(){
    let newDateTime = new Date();
    // let timeZoneNew = newDateTime.toLocaleTimeString();

    const[timeZoneNew,setTime] = useState(newDateTime.toLocaleTimeString());
    const newTime = () => {
        setTime(timeZoneNew.toLocaleTimeString());
    }

    
    return(
        <>
            <div className='mainWrapper'>
            <div className='innerWrapper'>
                <div className='bar'>
                    <p>{timeZoneNew}</p>
                    <button onClick={newTime}>Get Time</button>
                </div>
            </div>
            </div>
        </>
    )
}

export default App;
